import { useLocation } from 'react-router'

const ErrorPage = () => {
  const error_code = useLocation().state
  console.log('123', error_code)
  return (
    <div>
      <h1>Error: Token not found</h1>
      <p>Please log in again.</p>
    </div>
  )
}

export default ErrorPage
